import React from 'react'
import './NavBar.css'
import rolgusIcon from '../images/icon.png'
import Menu from './MenuDesp'
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Button from './Boton'


class NavBar extends React.Component {
    click = () => {
        
    }
    render() {
        return (
            <div id="navbar">
                <img src={rolgusIcon} alt="Rolgus Minecraft Skin Face "/>
                <h1>Rolgus</h1>
                <i className='bx bx-menu' onClick={this.click()}></i>
                <Router>
                    <Link to="/Portales"><Button /></Link><br />
                    <Link to="/RestBlocks">RestBlocks</Link><br />
                    <Link to="/Circulos">Circulos</Link><br />
                </Router>
            </div>
        )
    }
}


export default NavBar;
